                width: 100% !important;
            }

            .mobile_hide {
                display: none;
            }

            .stack .column {
                width: 100%;
                display: block;
            }

            .mobile_hide {
                min-height: 0;
                max-height: 0;
                max-width: 0;
                overflow: hidden;
                font-size: 0px;
            }

            .desktop_hide,
            .desktop_hide table {
                display: table !important;
                max-height: none !important;
            }

            .reverse {
                display: table;
                width: 100%;
            }

            .reverse .column.first {
                display: table-footer-group !important;
            }

            .reverse .column.last {
                display: table-header-group !important;
            }

            .row-12 td.column.first>table,
            .row-12 td.column.last>table,
            .row-9 td.column.first>table,
            .row-9 td.column.last>table {
                padding-left: 0;
                padding-right: 0;
            }

            .row-12 td.column.first .border,
            .row-9 td.column.first .border {
                border-top: 0 solid #111;
                border-right: 0px solid #111;
                border-bottom: 0 solid #111;
                border-left: 0 solid #111;
            }

            .row-12 td.column.last .border,
